                <Navbar />
                <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-center text-black font-bold">
                    <h1 className="sm:text-6xl text-4xl">No Leet Cheat</h1>
                    <p className="mt-4 text-gray-700">Browser extension for Chrome that will land you a job!</p>
                </div>
            </div>
        </>
    );
};
